const uploadToCloudinary = async (image, symbol) => {
  const url = await uploadTokenLogo(image, symbol);
  return url;
  // res.json(url);
};

const uploadTokensLogoToCloudinary1 = async (page) => {
  let tokenUrl;
  page?.map(async (token) => {
    tokenUrl = await uploadToCloudinary(token?.image, token?.symbol);
  });
  // add function for saving token to database
  return tokenUrl;
};

const uploadTokensLogoToCloudinary = async () => {
  const page = await searchTokenMarketInfo(250, 1);
  let tokenUrl;
  page?.map(async (token) => {
    tokenUrl = await uploadToCloudinary(token?.image, token?.symbol);
    // add function for saving token to database
    let result = await Tokens.create({
      id: token?.id,
      symbol: token?.symbol,
      name: token?.name,
      image: token?.image,
      tokenUrl, // newly updated with cloudinary from image and symbol
      current_price: token?.current_price,
      market_cap: token?.market_cap,
      market_cap_rank: token?.market_cap_rank,
      fully_diluted_valuation: token?.fully_diluted_valuation,
      total_volume: token?.total_volume,
      high_24h: token?.high_24h,
      low_24h: token?.low_24h,
      price_change_24h: token?.price_change_24h,
      price_change_percentage_24h: token?.price_change_percentage_24h,
      market_cap_change_24h: token?.market_cap_change_24h,
      market_cap_change_percentage_24h: token?.market_cap_change_percentage_24h,
      circulating_supply: token?.circulating_supply,
      total_supply: token?.total_supply,
      max_supply: token?.max_supply,
      ath: token?.ath,
      ath_change_percentage: token?.ath_change_percentage,
      ath_date: token?.ath_date,
      atl: token?.atl,
      atl_change_percentage: token?.atl_change_percentage,
      atl_date: token?.atl_date,
      roi: token?.roi,
      last_updated: token?.last_updated,
    });

    if (result) {
      // res.status(200).json(result);
      console.log(result);
    }
  });
};

